import React from 'react'

function Img(props){
    return(
          <img src={props.img} alt='logo' style={{maxWidth: '100%'}} />
    )
}

Profil.defaultProps = { FullName: 'kimo',
                         Bio: 'im a master in programming',
                         Profesion: 'programmer',
                       }
export default Img
